                return;
            var row = obj.Rows[0];
            lueItem.EditValue = row["U_ItemID"];
            lueKindOfLabel.EditValue = row["U_KindOfLabelID"];
            rgAutomatic.EditValue = row["U_Automatic"];
            ceSumitomo.Checked = Convert.ToBoolean(Convert.ToInt32(row["U_Sumitomo"]));
            teType.EditValue = row["U_Type"];
            teThick.EditValue = row["U_Thick1"];
            //teThick2.EditValue = row["U_Thick2"];
