            lueCoreIDLength.EditValue = row["U_CoreIDLength"];
            ceKoreaType.Checked = Convert.ToBoolean(Convert.ToInt32(row["U_KoreaType"]));
            ceLabelPrint.Checked = Convert.ToBoolean(Convert.ToInt32(row["U_LabelType"]));
            teYear.EditValue = row["U_Year"];
            teLine.EditValue = row["U_Line"];
            teMon.EditValue = row["U_Mon"];
