        void autoDate()
        {
            if (rgAutomatic.EditValue == "0")
            {
                var date = Utility.GetObjects("SELECT CASE WHEN(HOUR(CURRENT_TIME)) < 7 THEN YEAR(ADD_DAYS(CURRENT_DATE, -1)) ELSE YEAR(CURRENT_DATE) END AS \"YEAR\", CASE WHEN(HOUR(CURRENT_TIME)) < 7 THEN MONTH(ADD_DAYS(CURRENT_DATE, -1)) ELSE MONTH(CURRENT_DATE) END AS \"Month\", CASE WHEN(HOUR(CURRENT_TIME)) < 7 THEN TO_VARCHAR(TO_DATE(ADD_DAYS(CURRENT_DATE, -1)), 'DD') ELSE TO_VARCHAR(TO_DATE(CURRENT_DATE), 'DD') END AS \"Day\" FROM DUMMY;");
                switch (date.Rows[0]["Year"].ToString())
                {
                    case "2016":teYear.EditValue = "G"; break;
                    case "2017": teYear.EditValue = "H"; break;
                    case "2018": teYear.EditValue = "I"; break;
                    case "2019": teYear.EditValue = "J"; break;
                    case "2020": teYear.EditValue = "K"; break;
                    case "2021": teYear.EditValue = "L"; break;
                    case "2022": teYear.EditValue = "M"; break;
                    case "2023": teYear.EditValue = "N"; break;
                    case "2024": teYear.EditValue = "O"; break;
                    case "2025": teYear.EditValue = "P"; break;
                    case "2026": teYear.EditValue = "Q"; break;
                    case "2027": teYear.EditValue = "R"; break;
                    case "2028": teYear.EditValue = "S"; break;
                    case "2029": teYear.EditValue = "T"; break;
                    case "2030": teYear.EditValue = "U"; break;
                    case "2031": teYear.EditValue = "V"; break;
                    case "2032": teYear.EditValue = "W"; break;
                    case "2033": teYear.EditValue = "X"; break;
                    case "2034": teYear.EditValue = "Y"; break;
                    case "2035": teYear.EditValue = "Z"; break;
                }
                if (date.Rows[0]["Month"].ToString() == "10")
                    teMon.EditValue = "A";
                else if (date.Rows[0]["Month"].ToString() == "11")
                    teMon.EditValue = "B";
                else if (date.Rows[0]["Month"].ToString() == "12")
                    teMon.EditValue = "C";
                else
                    teMon.EditValue = date.Rows[0]["Month"];

                teDay.EditValue = date.Rows[0]["Day"].ToString();

                teYear.Properties.ReadOnly = true;
                teMon.Properties.ReadOnly = true;
                teDay.Properties.ReadOnly = true;

            }
            else
            {
                //teYear.EditValue = "";
                //teMon.EditValue = "";
                //teDay.EditValue = "";
                teYear.Properties.ReadOnly = false;
                teMon.Properties.ReadOnly = false;
                teDay.Properties.ReadOnly = false;
            }
        }

