        private bool validateData()
        {
            if (lueItem.EditValue == "")
            {
                MessageBox.Show("Item Must Be Choose !!");
                return false;
            }

            if (teYear.EditValue == null)
                teYear.EditValue = "";

            if (teLine.EditValue == null)
                teLine.EditValue = "";

            if (teMon.EditValue == null)
                teMon.EditValue = "";

            if (teDay.EditValue == null)
                teDay.EditValue = "";

            if (teYear.EditValue.ToString() == "")
            {
                MessageBox.Show("Year Harus di isi!!");
                return false;
            }

            if (teLine.EditValue.ToString() == "")
            {
                MessageBox.Show("Line Harus di isi!!");
                return false;
            }

            if (teMon.EditValue.ToString() == "")
            {
                MessageBox.Show("Mon Harus di isi!!");
                return false;
            }

            if (teDay.EditValue.ToString() == "")
            {
                MessageBox.Show("Day Harus di isi!!");
                return false;
            }

            barcode = teYear.EditValue.ToString() + teLine.EditValue + teMon.EditValue + teDay.EditValue + teMillRollNo.EditValue + lueTeam.EditValue + teSlitterNo.EditValue + teDoffingNo.EditValue + lueArmNo.EditValue;
            var statusBarcode = Utility.GetObjects(string.Format("SELECT \"U_Status\" AS \"Status\" FROM \"@ITEMDETAIL\" WHERE \"U_Barcode\" LIKE '{0}' AND \"Code\" <>  '{1}' AND \"U_IsDeleted\" = 0", barcode, this.oid));
            if (statusBarcode.Rows.Count != 0)
            {
                    MessageBox.Show("Duplicate Roll Number");
                    return false;
            }
            if (teSlitterNo.EditValue == null)
                teSlitterNo.EditValue = "";

            if (lueCoreIDLength.EditValue == null)
                lueCoreIDLength.EditValue = "";

            if (lueGrade.EditValue == null)
                lueGrade.EditValue = "";


            if (teSlitterNo.EditValue.ToString() == "")
            {
                MessageBox.Show("Slitter No Harus di Isi !!");
                return false;
            }
            if (lueCoreIDLength.EditValue.ToString() == "")
            {
                MessageBox.Show("Core ID Harus di Isi !!");
                return false;
            }
            if (lueGrade.EditValue.ToString() == "")
            {
                MessageBox.Show("Grade Harus di Isi !!");
                return false;
            }
            if (teMillRollNo.EditValue.ToString().Length < 2)
            {
                MessageBox.Show("Mill Roll Minimal 2!!");
                return false;
            }
            return true;
        }
