        private void lueItem_EditValueChanged(object sender, EventArgs e)
        {
            if (lueItem.EditValue == null)
                return;
            var obj = Utility.GetObjects(string.Format("SELECT TOP 1 T0.*, T0.\"U_idu_corona\" AS \"Corona\", T0.\"U_idu_chemtreat\" AS \"Chemical\", T1.\"U_idu_prd\" AS \"TypeItem\", T0.\"SWeight1\" AS \"Weight\" FROM OITM T0 INNER JOIN OITB T1 ON T0.\"ItmsGrpCod\" = T1.\"ItmsGrpCod\" WHERE T0.\"ItemCode\" = '{0}'", lueItem.EditValue));
            if (obj.Rows.Count == 0)
                return;
            var row = obj.Rows[0];
            teType.EditValue = row["U_idu_spec_typ"];

            teThick.EditValue = row["U_idu_thick"];
            //teThick.EditValue = row[""];

            teWidth1.EditValue = row["U_idu_i_width"];
            //teWidth2.EditValue = row[""];
            
            //teType2.EditValue = row[""];

            switch (row["Corona"] == "" ? 0 : Convert.ToInt32(row["Corona"]))
            {
                case 0: teCorona.EditValue = ""; break;
                case 1: teCorona.EditValue = "Inside"; break;
                case 2: teCorona.EditValue = "Bothside"; break;
                case 3: teCorona.EditValue = "Outside"; break;
            }
            switch (row["Chemical"] == "" ? 0 : Convert.ToInt32(row["Chemical"]))
            {
                case 0: teChemical.EditValue = ""; break;
                case 1: teChemical.EditValue = "Inside"; break;
                case 2: teChemical.EditValue = "Bothside"; break;
                case 3: teChemical.EditValue = "Outside"; break;
            }
            teLength1.EditValue = row["U_idu_i_length"];
            //teLength2.EditValue = row[""];
            //if (row["TypeItem"] == "PET")
            //{
            //    teNWeight1.EditValue = (int)Math.Floor((Convert.ToDouble(teThick.EditValue) * Convert.ToDouble(teWidth1.EditValue) * Convert.ToDouble(teLength1.EditValue) * 1.4 / 1000000) / 1);
            //}
            //else
            //{
            //    teNWeight1.EditValue = (int)Math.Floor((Convert.ToDouble(teThick.EditValue) * Convert.ToDouble(teWidth1.EditValue) * Convert.ToDouble(teLength1.EditValue) * 1.6 / 1000000) / 1);
            //}

            teNWeight1.EditValue = row["Weight"];
            //teNWeight2.EditValue = row[""];
            if (lueItem.EditValue.ToString().Substring(0, 2) == "FP")
            {
                teNP.EditValue = "P";
            }
            else if (lueItem.EditValue.ToString().Substring(0, 2) == "NT")
            {
                teNP.EditValue = "T";
            }
            else //if (lueItem.EditValue.ToString().Substring(0, 2) == "NP")
            {
                teNP.EditValue = "N";
            }
            //teNP.EditValue = lueItem.EditValue.ToString().Substring(0, 2) == "FP" ? "P" : "N";

            teName.EditValue = lueItem.Text;
            lueWHInDivision.EditValue = "107";

            if (row["ItmsGrpCod"].ToString() == "210")
                lueMachineNo.EditValue = "9011";
            else if (row["ItmsGrpCod"].ToString() == "211")
                lueMachineNo.EditValue = "9021";
            else
                lueMachineNo.EditValue = "9031";

            tplArticle();
        }

