        private void lueKindOfLabel_EditValueChanged(object sender, EventArgs e)
        {
            try
            {
                if (lueKindOfLabel.EditValue.ToString().Substring(0,3) == "TPL")
                {
                    lciPONumber.Visibility = DevExpress.XtraLayout.Utils.LayoutVisibility.Always;
                    lciTPLArticle.Visibility = DevExpress.XtraLayout.Utils.LayoutVisibility.Always;
                    tplArticle();
                }
                else
                {
                    lciPONumber.Visibility = DevExpress.XtraLayout.Utils.LayoutVisibility.Never;
                    lciTPLArticle.Visibility = DevExpress.XtraLayout.Utils.LayoutVisibility.Never;
                }
            }
            catch (Exception)
            {

            }
        }
        void tplArticle()
        {
            if (lciTPLArticle.Visibility == DevExpress.XtraLayout.Utils.LayoutVisibility.Never)
                return;

            var tplArticle = "420";

            if (teType.EditValue == null)
                teType.EditValue = "";
            if (teType.EditValue.ToString().Substring(0, 2) == "NP")
                tplArticle = tplArticle + "0";
            else if (teType.EditValue.ToString().Substring(0, 2) == "NT")
                tplArticle = tplArticle + "1";
            else if (teType.EditValue.ToString().Substring(0, 2) == "NE")
                tplArticle = tplArticle + "4";
            else
                tplArticle = tplArticle + "";

            if (teCorona.EditValue == null)
                teCorona.EditValue = "";
            if (teChemical.EditValue == null)
                teChemical.EditValue = "";
            if (teCorona.EditValue.ToString().ToUpper() == "INSIDE")
                tplArticle = tplArticle + "1";
            else if (teCorona.EditValue.ToString().ToUpper() == "BOTHSIDE")
                tplArticle = tplArticle + "2";
            else if (teCorona.EditValue.ToString().ToUpper() == "OUTSIDE")
                tplArticle = tplArticle + "3";
            else
                tplArticle = tplArticle + "0";

            tplArticle = tplArticle + ".";

            if (teThick.EditValue == null)
                teThick.EditValue = "";

            tplArticle = tplArticle + teThick.EditValue;

            tplArticle = tplArticle + ".";

            if (teWidth1.EditValue == null)
                teWidth1.EditValue = "";

            tplArticle = tplArticle + teWidth1.EditValue;

            if (teChemical.EditValue.ToString().ToUpper() == "INSIDE")
                tplArticle = tplArticle + "i";
            else if (teChemical.EditValue.ToString().ToUpper() == "BOTHSIDE")
                tplArticle = tplArticle + "b";
            else if (teChemical.EditValue.ToString().ToUpper() == "OUTSIDE")
                tplArticle = tplArticle + "u";
            else
                tplArticle = tplArticle + "o";

            if (lueCoreIDLength.EditValue == null)
                lueCoreIDLength.EditValue = "";
            if (lueCoreIDLength.EditValue.ToString().Substring(0, 1) == "3")
                tplArticle = tplArticle + "2";
            else
                tplArticle = tplArticle + "1";

            if (teLength1.EditValue == null)
                teLength1.EditValue = "";
            if (teLength1.EditValue.ToString() == "18000")
                tplArticle = tplArticle + "0";
            else
                tplArticle = tplArticle + "3";

            teTPLArticle.EditValue = tplArticle;
        }

        private void teYear_KeyUp(object sender, KeyEventArgs e)
        {
            string Str = teYear.Text.Trim();

            double Num;

            bool isNum = double.TryParse(Str, out Num);
            if (isNum)
            {
                MessageBox.Show("Tidak Boleh angka");
                teYear.EditValue = "";
            }
            else
                teYear.EditValue = teYear.EditValue.ToString().ToUpper();
        }

        private void teLine_PreviewKeyDown(object sender, PreviewKeyDownEventArgs e)
        {
            if (rgAutomatic.EditValue == null)
                rgAutomatic.EditValue = "";
            if (e.KeyCode == Keys.Tab)
            {
                if (rgAutomatic.EditValue.ToString() == "0")
                {
                    teDay.Focus();
                }
            }

        }
